import s from "./App.module.css";
import Nav from "./components/Nav/Nav";
import Footer from "./components/Footer/Footer";
import Profile from "./components/Main/Profile/Profile";
import Dialogs from "./components/Main/Dialogs/Dialogs";
import Burger from "./components/Nav/burger_menu/burger";
import { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App(props) {
  const [menuActive, setMenuActive] = useState(false);
  return (
    <BrowserRouter>
      <div className={s.app_wrapper}>
        <Nav active={menuActive} setActive={setMenuActive} items={props.BurgerItems} logo ={props.BurgerLogo}/>
        <div className="item2">
          <Routes>
            <Route path="/" element={<Profile postData={props.postData} />} />
            <Route
              path="/Profile"
              element={<Profile postData={props.postData} />}
            />
            <Route
              path="/Dialogs"
              element={
                <Dialogs
                  MessageData={props.MessageData}
                  DialogsData={props.DialogsData}
                />
              }
            />
          </Routes>
        </div>
        <Footer />
      </div>
    </BrowserRouter>
  );
}

export default App;
